import {Row, Col, Button, Icon} from "antd";

function Header() {
	return (
		<Row>
			<Col xs={2} sm={4} md={6} lg={6} xl={6}>
				col-12
			</Col>
			<Col xs={2} sm={4} md={6} lg={18} xl={18}>
				col-12
			</Col>
		</Row>
	);
}

export default Header;
